import './App.css';
import {Button} from "semantic-ui-react";
import {useNavigate} from 'react-router-dom';


function App() {
  const navigate = useNavigate();
  const createpage = () => {
    navigate('/create');
}

  return (
    <div className="">
      <h1>CRUD Application</h1>

      <Button onClick={createpage}> Create New User</Button>

    </div>
  );
}

export default App;
